from rest_framework import serializers
from frigobar.models.photo import Photo
from drf_extra_fields.fields import Base64ImageField
import base64
import matplotlib.pyplot as plt
import matplotlib.image as mpimg

class PhotoSerializer(serializers.ModelSerializer):
    photo = Base64ImageField(required=False)

    class Meta:
        model = Photo
        depth = 0
        fields = ["id", "product", "photoType", "photo"]

    def create(self, validated_data):
        teste = "data:image/jpg;base64,"
        #imgdata = base64.b64decode(teste)
        imgdata = validated_data['photo'].file.read()
        plt.imshow(imgdata)
        plt.show()

        instance = Photo.objects.create(
            product=validated_data['product'], photoType=validated_data['photoType'], directory=5
        )

        return instance